  render(){

    const { PunkPrintRegistry } = this.props.drizzleState.contracts;
    //console.log(PunkPrintRegistry);
    const pricePerPrintInWei = PunkPrintRegistry.pricePerPrintInWei['0x0'].value;
    const pricePerPrintIntlShipInWei = PunkPrintRegistry.pricePerPrintIntlShipInWei['0x0'].value;
    const pricePerNFCInWei = PunkPrintRegistry.pricePerNFCInWei['0x0'].value;
    const pricePerNFCIntlShipInWei = PunkPrintRegistry.pricePerNFCIntlShipInWei['0x0'].value;
    const pricePerMiscInWei = PunkPrintRegistry.pricePerMiscInWei['0x0'].value;
    const pricePerMiscIntlShipInWei = PunkPrintRegistry.pricePerMiscIntlShipInWei['0x0'].value;


    this.setState({ pricePerPrintInWei, pricePerPrintIntlShipInWei, pricePerNFCInWei, pricePerNFCIntlShipInWei, pricePerMiscInWei, pricePerMiscIntlShipInWei });

